import './App.css';
import { BrowserRouter as Router, Route, Routes,Provider } from 'react-router-dom';
import Navbar from './Components/Common/Header/Navbar';
import HomePage from './Components/HomePage/HomePage';
import Sponsored from './Components/Sponsored/Sponsored';
import Content from './Components/Common/Content/Content'
import Footer from './Components/Common/Footer/Footer';
import Items from './Components/AboutPage/Items/Items.Jsx';
import {CreateStore} from 'react-redux'


function App() {

  let initialState = {user:[]};
  const rootReducer = (state = initialState, action ) => { 
    return state 
  }

  let state = createStore(rootReducer)





  return (
    <Router>
      <div className="App">
        {/* Place non-route components outside of the Routes component */}
        <Navbar />
        <HomePage />
        <Sponsored />
        <Content />
        <Footer />
        {/* Define routes within the Routes component */}
        <Routes>
        <Route path="/items" element={<Items />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
